import React, { useState } from "react";
import { Component } from "react";
import { useEffect } from "react";
import Player from "../Player";


 function PlayMe({accessToken}){  
  
   
  return(
    <div>
      <Player accessToken ={accessToken} />
    </div>
  )
  
 }

 export default PlayMe;
